local function inRect(x,y,x1,y1,x2,y2)
	if x >= x1 and x <= x2 then	
		if y >= y1 and y <= y2 then	
			return true		
		else
			return false		
		end		
	else
		return false	
	end
end

--dragging the game window
function dragHandler()
    local mouse_x, mouse_y = input.GetMousePos();

    if (is_dragging == true) then
        boardx = mouse_x - dragging_offset_x;
        boardy = mouse_y - dragging_offset_y;
        return;
    end
	
    if (mouse_x >= boardx - 272 and mouse_x <= boardx + 541 + 1 and mouse_y >= boardy + 63 and mouse_y <= boardy + 674) then
        is_dragging = true;
        dragging_offset_x = mouse_x - boardx;
        dragging_offset_y = mouse_y - boardy;
        return;
    end
end

local function readscores()

	local f = file.Open("LUA_Tetris_Highscores.dat", "r")
	if f ~= nil then
		local scores = f:Read()
		f:Close()
		
		for score in string.gmatch(scores, "%S+") do
			table.insert(highscores,score)
		end
	elseif f == nil then
		local newfile = file.Open("LUA_Tetris_Highscores.dat", "w")
		newfile:Close()
	end
	
	while #highscores < 5 do
		table.insert(highscores, 0)	
	end

end

readscores()

local function writescores()
	local newscores = ""
	
	for i,v in ipairs(highscores) do
		newscores = newscores .. v
		if i < 5 then
			newscores = newscores .. " "
		end
	end
	
	local f = file.Open("LUA_Tetris_Highscores.dat", "w")
	f:Write(newscores)
	f:Close()
end

local function insertscore(newscore)
local s1, s2, s3, s4, s5
local changed = false

	for i,v in ipairs(highscores) do
		if i == 1 then
			s1 = tonumber(v)
		elseif i == 2 then
			s2 = tonumber(v)
		elseif i == 3 then
			s3 = tonumber(v)
		elseif i == 4 then
			s4 = tonumber(v)
		elseif i == 5 then
			s5 = tonumber(v)
		end
	end
	
	if newscore > s1 then
		s5 = s4
		s4 = s3
		s3 = s2
		s2 = s1
		s1 = newscore
		changed = true
	elseif newscore > s2 then
		s5 = s4
		s4 = s3
		s3 = s2
		s2 = newscore
		changed = true
	elseif newscore > s3 then
		s5 = s4
		s4 = s3
		s3 = newscore
		changed = true
	elseif newscore > s4 then
		s5 = s4
		s4 = newscore
		changed = true
	elseif newscore > s5 then
		s5 = newscore
		changed = true
	end
	
	if changed then
		highscores = {s1, s2, s3, s4, s5}
		writescores()
	end
	
end

--we need a board... so let's make one, 10x24.
local function buildboard()
	for w = 1, 10 do
		local line = {}
		for h = 1, 24 do
			local pos = {}
			pos.block = false
			pos.color = {0,0,0}
			pos.colorinverse = {0,0,0}
			table.insert(line, pos)
		end
		table.insert(board, line)
	end
end

buildboard()

--put current piece aside
local function savepiece()
	if savedpiece == nil then
		savedpiece = currpiece
		currpiece = nil
	else
		local temp = savedpiece
		savedpiece = currpiece
		currpiece = temp
	end
end

--check if we're hitting anything or moving outside the board
local function collision()
	if currpiece ~= nil then
		for i, piece in ipairs(currpiece.blocks[dir]) do
			local h = piece[1] + currpos.y
			local w = piece[2] + currpos.x
			if w > 10 or w < 1 then
				return true
			end
			if h > 24 or h < 1 then
				return true
			end
			local check = board[w][h]
			if check ~= nil then
				if check.block then
					return true
				end
			end
		end
	end
	return false
end

--reset the game after losing
local function reset()
	board, currpos, ghostpos, nextpieces, animrows = {}, {}, {}, {}, {}
	buildboard()
	currpiece, savedpiece = nil, nil
	currpos.x, currpos.y, ghostpos.x, ghostpos.y = 4, 1, 4, 1
	rotation, step, moves, lock, palpha, level, rows, steptime, score, prevscore = 1, 0, 0, 0, 255, 1, 0, 1, 0, 0
	dir = "up"
	ml, mr, rl, rr = false, false, false, false
	locking, placed, tspin, rotated, saved, lost = false, false, false, false, false, false
	level = levelmod
	steptime = (0.8-((level-1)*0.007))^(level-1)
	steptime = math.floor(steptime*100000)/100000
end

--remove full rows and add score
local function checkrows()
local cleared = 0
local count = {}
	for i = 1, 24 do
		count[i] = 0
	end
	for i, line in ipairs(board) do
		for ii, pos in ipairs(line) do
			if pos.block then
				if ii <= 4 then
					lost = true --if there's a block placed in the top 4 rows (outside the game area) then we lose
				else
				count[ii] = count[ii] + 1
				end
			end
		end
	end
	if not lost then
		for i, num in ipairs(count) do
			if num == 10 then
				cleared = cleared + 1
				local animinfo = {i, 0, 10, 0}
				table.insert(animrows, animinfo)
			end
		end
		if cleared > 0 then
			rows = rows + cleared
		end
		if tspin then
			if cleared == 0 then
				score = score + (400 * level)
				prevscore = 0
			elseif cleared == 1 then
				if prevscore == 2 then
					score = score + (1200 * level)
				else
					score = score + (800 * level)
				end
				prevscore = 2
			elseif cleared == 2 then
				if prevscore == 3 then
					score = score + (1800 * level)
				else
					score = score + (1200 * level)
				end
				prevscore = 3
			elseif cleared == 3 then
				if prevscore == 4 then
					score = score + (2400 * level)
				else
					score = score + (1600 * level)
				end
				prevscore = 4
			end
		else
			if cleared == 0 then
				prevscore = 0
			elseif cleared == 1 then
				score = score + (100 * level)
				prevscore = 0
			elseif cleared == 2 then
				score = score + (300 * level)
				prevscore = 0
			elseif cleared == 3 then
				score = score + (500 * level)
				prevscore = 0
			elseif cleared == 4 then
				if prevscore == 1 then
					score = score + (1200 * level)
				else
					score = score + (800 * level)
				end
				prevscore = 1
			end
		end
		level = math.floor(rows / 10) + levelmod --every 10 rows increases level by 1
		if level > 15 then level = 15 end --cap level at 15
		steptime = (0.8-((level-1)*0.007))^(level-1) --tetris guidelines say it should be like this
		steptime = math.floor(steptime*100000)/100000 --cap it to 5 digits
	elseif lost then
		insertscore(score)
	end
end

--placing our current piece
local function placepiece()
	if currpiece == nil then
		return
	end
	
	for i, piece in ipairs(currpiece.blocks[dir]) do
		local h = piece[1] + currpos.y
		local w = piece[2] + currpos.x
		local place = board[w][h]
		place.block = true
		place.color = {currpiece.color[1],currpiece.color[2],currpiece.color[3]}
		place.colorinverse = {255 - currpiece.color[1], 255 - currpiece.color[2], 255 - currpiece.color[3]}
	end
	
	--reset stuff to prepare for next piece
	rotation = 1
	dir = "up"
	currpos.x = 4
	currpos.y = 1
	currpiece = nil
	checkrows()
	placing = false
	lock = 0
	moves = 0
	palpha = 255
	step = 0
	saved = false
end

