				[1] = {1, 0},
				[2] = {1, 1},
				[3] = {0, -2},
				[4] = {1, -2}
			}
		},
		ccw = {
			[1] = {
				[1] = {1, 0},
				[2] = {1, -1},
				[3] = {0, 2},
				[4] = {1, 2}
			},
			[2] = {
				[1] = {-1, 0},
				[2] = {-1, 1},
				[3] = {0, -2},
				[4] = {-1, -2}
			},
			[3] = {
				[1] = {-1, 0},
				[2] = {-1, -1},
				[3] = {0, 2},
				[4] = {-1, 2}
			},
			[4] = {
				[1] = {1, 0},
				[2] = {1, 1},
				[3] = {0, -2},
				[4] = {1, -2}
			}
		}
	}
}

local function SRSrotation(rdir)
local tempx, tempy = currpos.x, currpos.y
local tn = nil
	if currpiece.name == "O" or currpiece.name == "I" then
		tn = currpiece.name
	else
		tn = "R"
	end
	if tn == "O" then
		if collision() then
			return false
		else 
			return true
		end
	else
		if collision() then
			for case = 1, 4 do
				currpos.x = currpos.x + wallkicks[tn][rdir][rotation][case][1]
				currpos.y = currpos.y + (wallkicks[tn][rdir][rotation][case][2] * -1) --multiplied by -1 because positive numbers meant up instead of
					if not collision() then	--if we didn't hit anything				  --down on the SRS wiki and I'm not correcting the entire table
						return true			--exit out of the loop and keep current position as the one we tested
					else 					--else reset position and try the next case
						currpos.x = tempx
						currpos.y = tempy
					end
			end
			return false --if we tested everything we can't rotate
		else
			return true
		end
	end
end

--get where our piece will get placed if we don't move it
local function getghost()
	if currpiece ~= nil then
		ghostpos.x = currpos.x
		ghostpos.y = currpos.y
		distance = 0
		local stop = false
		local moved = false
		
		::loop::
		
		--see if any parts of our ghost piece hit anything
		for i, piece in ipairs(currpiece.blocks[dir]) do
			local h = piece[1] + ghostpos.y
			local w = piece[2] + ghostpos.x
			if w > 10 or w < 1 then
				stop = true
			end
			if h > 24 or h < 1 then
				stop = true
			end
			if board[w][h] ~= nil then
				local check = board[w][h]
				if check ~= nil then
					if check.block then
						stop = true
					end
				end
			end
		end
		
		-- if it didn't hit anything move 1 down
		if not stop then 
			ghostpos.y = ghostpos.y + 1
			distance = distance + 1 --count how much we can move
			moved = true
			goto loop -- try again with the new position
		elseif moved then -- if we hit something then undo our last move and exit out of the loop
			ghostpos.y = ghostpos.y - 1
		end
		distance = distance - 1
	end
end

--check for tspins
local function tspincheck()
	local cornercount = 0
	local middle = {}
	middle.x = currpos.x + 1
	middle.y = currpos.y + 2
	--if at least 3 out of the 4 diagonally adjacent pieces of our T are occupied and the last move was a rotation then we did a tspin
	if (middle.x - 1) < 1 or (middle.y - 1) < 1 then
		cornercount = cornercount + 1
	elseif board[(middle.x - 1)][(middle.y - 1)].block then
		cornercount = cornercount + 1
	end
	if (middle.x + 1) > 10 or (middle.y - 1) < 1 then
		cornercount = cornercount + 1
	elseif board[(middle.x + 1)][(middle.y - 1)].block then
		cornercount = cornercount + 1
	end
	if (middle.x - 1) < 1 or (middle.y + 1) > 24 then
		cornercount = cornercount + 1
	elseif board[(middle.x - 1)][(middle.y + 1)].block then
		cornercount = cornercount + 1
	end
	if (middle.x + 1) > 10 or (middle.y + 1) > 24 then
		cornercount = cornercount + 1
	elseif board[(middle.x + 1)][(middle.y + 1)].block then
		cornercount = cornercount + 1
	end
	if cornercount >= 3 then
		tspin = true
	end
end

--main game functions
local function game()
	if not lost and not paused and not homescreen and animrows[1] == nil then
		if settingstoggle then
			settingswindow:SetActive(0)
			settingstoggle = false
		end
		if not gameopened:GetValue() then
			paused = true
		end
		local dt = globals.AbsoluteFrameTime()
		local speedup = false
		tspin = false

		--generate next 3 pieces to display on the side using tetris standard random generation
		while #nextpieces < 3 do
			local r = math.random(1,#bag)
			local l = bag[r]
			table.insert(nextpieces, pieces[l])
			table.remove(bag, r)
			if #bag <= 0 then
				bag = {"I","O","T","S","Z","J","L"}
			end
		end

		--get new piece if we don't have one
		if currpiece == nil then
			currpiece = nextpieces[1]
			table.remove(nextpieces, 1)
		end
		
		--controls and stuff
		if input.IsButtonPressed(keys.moveleft) and not ml then -- left arrow to move left
			currpos.x = currpos.x - 1
			if collision() then
				currpos.x = currpos.x + 1
			else
				rotated = false
				moves = moves + 1
				lock = 0
				palpha = 255
			end
			ml = true
		end
		
		if input.IsButtonPressed(keys.moveright) and not mr then -- right arrow to move right
			currpos.x = currpos.x + 1
			if collision() then
				currpos.x = currpos.x - 1
			else
				rotated = false
				moves = moves + 1
				lock = 0
				palpha = 255
			end
			mr = true
		end

		if input.IsButtonPressed(keys.hold) and not saved then -- c to save piece
			savepiece()
			currpos.x = 4
			currpos.y = 1
			rotation = 1
			dir = "up"
			moves = 0
			lock = 0
			palpha = 255
			step = 0
			rotated = false
			saved = true
		end

		if input.IsButtonPressed(keys.rotateleft) and not rl then -- z to rotate counter-clockwise
			rotation = rotation - 1
			if rotation < 1 then 
				rotation = 4
			end
			dir = dirs[rotation]
				if not SRSrotation("ccw") then
				rotation = rotation + 1
				if rotation > 4 then 
					rotation = 1
				end
				dir = dirs[rotation]
			else
				rotated = true
				moves = moves + 1
				lock = 0
				palpha = 255
			end
			rl = true
		end
		
		if input.IsButtonPressed(keys.rotateright) and not rr then -- up to rotate clockwise
			rotation = rotation + 1
			if rotation > 4 then 
				rotation = 1
			end
			dir = dirs[rotation]
			if not SRSrotation("cw") then
				rotation = rotation - 1
				if rotation < 1 then 
					rotation = 4
				end
				dir = dirs[rotation]
			else
				rotated = true
				moves = moves + 1
				lock = 0
				palpha = 255
			end
			rr = true
		end
		
		if input.IsButtonPressed(27) and not pt then -- esc to pause
			paused = true
			pt = true
		end
		
		step = step + dt

		--get our ghost piece every frame because it broke sometimes if I only call it when our piece moved and I don't know why
		--it's tetris, 250 fps or 240 doesn't make a difference.	
		if currpiece ~= nil then
			getghost()
		end
		
		--if we can't move down, count how long we haven't been able to move for
		if distance <= 0 then
			lock = lock + dt
			placing = true
		elseif distance >= 1 then -- reset stuff if we can move down
			placing = false
			lock = 0
			palpha = 255
			if distance >= 2 then -- reset move count if we can move down 2 ore more spaces
				moves = 0
			end
		end
		
		--speed up our piece falling
		if input.IsButtonDown(keys.softdrop) then
			speedup = true
			speedtime = steptime / (17 - level)
		end
		
		if placing then
			--fading effect if the piece is about to be placed
			if palpha > 25 then
				if speedup then
					palpha = palpha - dt*850
				else
					palpha = palpha - dt*450
				end
			end
			--if we haven't been able to move down for 0.5 or made 15 moves place our piece
			if lock >= 0.5 or moves >= 15 or (speedup and lock >= 0.25) then
				if rotated and currpiece.name == "T" then
					tspincheck()
				end
				placepiece()
			end
		end
		
		--move down 
		if step >= steptime or (speedup and steptime > 0.05 and step >= 0.05)then
			if distance > 0 then
				currpos.y = currpos.y + 1
				rotated = false
				if speedup and steptime > 0.05 then
					score = score + 1
				end
			end
			step = 0
		end
		
		if input.IsButtonDown(keys.harddrop) and not placed then --space to hard drop
			if currpos.x == ghostpos.x and currpos.y == ghostpos.y and rotated and currpiece.name == "T" then
				tspincheck()
			end
			currpos.x, currpos.y = ghostpos.x, ghostpos.y
			placed = true
			rotated = false
			score = score + (distance * 2)
			placepiece()
		end
	end
	if paused and helpscreen == 0 then
		if input.IsButtonPressed(27) and not pt then
			paused = false
			pt = true
		end
	end
	if input.IsButtonReleased(keys.moveleft) and ml then --left arrow to move left
		ml = false
	end
	if input.IsButtonReleased(keys.moveright) and mr then --right arrow to move right
		mr = false
	end
	if input.IsButtonReleased(keys.rotateleft) and rl then --z to rotate counter-clockwise
		rl = false
	end
	if input.IsButtonReleased(keys.rotateright) and rr then --up to rotate clockwise
		rr = false
	end
	if input.IsButtonReleased(keys.harddrop) then --space to hard drop
		placed = false
	end
	if input.IsButtonReleased(27) then --esc to pause
		pt = false
	end
end

