--animation for removing full rows.
local function animations()
	if animrows[1] ~= nil then
		local dt = globals.AbsoluteFrameTime()
		for i, row in ipairs(animrows) do
			if row[2] == 2 and row[3] > 0 then
				for ii, line in ipairs(board) do 
					if row[3] > 0 then
						table.remove(line, row[1])
						local pos = {}
						pos.block = false
						pos.color = {0,0,0}
						pos.colorinverse = {0,0,0}
						table.insert(line, 1, pos)
						row[3] = row[3] - 1
						if row[3] <= 0 then 
							row[4] = 1
						end
					end
				end
			end
			for ii, line in ipairs(board) do	
				if row[2] == 0 then
					for num = 1, 3 do
						line[row[1]].color[num] = line[row[1]].color[num] + ((line[row[1]].colorinverse[num] * dt) * 10)
						if line[row[1]].color[num] > 255 then 
							line[row[1]].color[num] = 255
						end
					end
					if line[row[1]].color[1] == 255 and line[row[1]].color[2] == 255 and line[row[1]].color[3] == 255 then
						row[2] = 1
					end
				end
				if row[2] == 1 then
					for num = 1, 3 do
						line[row[1]].color[num] = line[row[1]].color[num] - ((255 * dt) * 5)
						if line[row[1]].color[num] < 50 then 
							line[row[1]].color[num] = 50
						end
					end
					if line[row[1]].color[1] == 50 and line[row[1]].color[2] == 50 and line[row[1]].color[3] == 50 then
						row[2] = 2
					end
				end
			end
		end
		local count = 0
		for i, idk in ipairs(animrows) do
			if idk[4] == 1 then
				count = count + 1
			end
		end
		if count == #animrows then
			animrows = {}
		end
	end
end

